import React, { Fragment } from "react";
import { Card, Row, Col, Divider } from "antd";

const ReservationList = ({ data }) => {
  return (
    <Fragment>
      <Row>
        {data.map(reserv => (
          <Col key={reserv.id}>
            <Card
              key={reserv.id}
              style={{ width: "300px" }}
              className="border border-info rounded"
              title={
                <h4 className="text-center">{`Table: ${reserv.table_number}`}</h4>
              }
              cover={
                <h4 className="text-center mt-4">{reserv.customer_name}</h4>
              }
            ></Card>
          </Col>
        ))}
      </Row>
    </Fragment>
  );
};

export default ReservationList;
